import React from 'react';

const Rank = (user) => {
	const { name, entries } = user;
	return (
		<div>
			<div className='white f5'>
				{`${name}, você já enviou`}
			</div>
			<div className='white f3'>
				{entries}
			</div>

			(
				if(entries === 1){
					<div className='white f5'>
						{`face válida!`}
					</div>
				} else {
					<div className='white f5'>
						{`faces válidas!`}
					</div>
				}

			)

		</div>

	)
}

export default Rank;
